import "./App.css";
import React, { Component } from "react";
import Nav from "react-bootstrap/Nav";
import name from "./name.png";
import ss1 from "./ss1.png";
import ss2 from "./ss2.png";
import ss3 from "./ss3.png";
import ss4 from "./ss4.jpg";

export default class App extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="App">
        <div className="top">
          <a href="/" aria-current="page" aria-label="home">
            <img src={name} width="250" alt="" />
          </a>
          <Nav className="nav">
            <Nav.Item>
              <Nav.Link href="/" className="nav-link">
                My Work
              </Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="#link" className="nav-link">
                About Me
              </Nav.Link>
            </Nav.Item>
          </Nav>
        </div>

        <div>
          <h1>
            Hola - I'm Caro :)
            <br />A creative...
          </h1>

          <div>
            <i>
              currently a software engineer @ <b>Microsoft</b>
            </i>
          </div>
        </div>
        <div className="works-container">
          <div className="work-item">
            <div className="image-container">
              <img
                src={ss1}
                className={item-image}
              />
              <h2>Responsive Redesign</h2>
            </div>
          </div>

          <div className="work-item">
            <div className="image-container">
              <img
                src={ss2}
                style={{ height: "250px", width: "420px", borderRadius: "8px" }}
              />
              <h2>Development</h2>
            </div>
          </div>
          <div className="work-item">
            <div className="image-container">
              <img
                src={ss3}
                style={{ height: "250px", width: "420px", borderRadius: "8px" }}
              />
              <h2>A/B Testing</h2>
            </div>
          </div>
          <div className="work-item">
            <div className="image-container">
              <img
                src={ss4}
                style={{ height: "250px", width: "420px", borderRadius: "8px" }}
              />
              <h2>Personas</h2>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
